// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity >=0.8.4;

import "../libraries/TransferHelper.sol";
import "../interfaces/IERC20.sol";
import "../interfaces/IDEXIntegration.sol";
import "../interfaces/external/ISyncswapFactory.sol";
import "../interfaces/external/ISyncswapPool.sol";
import "../base/Lockable.sol";

contract SyncswapClassicDEXIntegration is IDEXIntegration, Lockable {
    address public immutable factory;

    constructor(address _factory) {
        factory = _factory;
    }

    function _getPair(
        address _tokenIn,
        address _tokenOut
    ) internal view returns (address) {
        return ISyncswapFactory(factory).getPool(_tokenIn, _tokenOut);
    }

    function validatePair(
        address _tokenIn,
        address _tokenOut
    ) external view override returns (bool) {
        if (_tokenIn == _tokenOut) {
            return false;
        }
        address pool = _getPair(_tokenIn, _tokenOut);
        if (pool != address(0)) {
            return true;
        }
        return false;
    }

    function _getAmountOut(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountIn
    ) internal view returns (uint256 amountOut) {
        address pool = _getPair(_tokenIn, _tokenOut);
        if (pool != address(0)) {
            amountOut = ISyncswapPool(pool).getAmountOut(
                _tokenIn,
                _amountIn,
                address(this)
            );
        }
    }

    function _getAmountIn(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountOut
    ) internal view returns (uint256 amountIn) {
        address pool = _getPair(_tokenIn, _tokenOut);
        if (pool != address(0)) {
            amountIn = ISyncswapPool(pool).getAmountIn(
                _tokenOut,
                _amountOut,
                address(this)
            );
        }
    }

    function getAmountOut(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountIn
    ) external view override returns (uint256 amountOut) {
        amountOut = _getAmountOut(_tokenIn, _tokenOut, _amountIn);
    }

    function getAmountIn(
        address _tokenIn,
        address _tokenOut,
        uint256 _amountOut
    ) external view override returns (uint256 amountIn) {
        amountIn = _getAmountIn(_tokenIn, _tokenOut, _amountOut);
    }

    function swap(
        address _tokenIn,
        address _tokenOut,
        address _to
    ) external override lock returns (uint256 amountOut) {
        uint256 amountIn = IERC20(_tokenIn).balanceOf(address(this));
        amountOut = _getAmountOut(_tokenIn, _tokenOut, amountIn);
        require(
            amountOut > 0,
            "SyncswapClassicIntegration: INSUFFICIENT_OUTPUT_AMOUNT"
        );
        address pair = _getPair(_tokenIn, _tokenOut);
        require(pair != address(0), "SyncswapClassicIntegration: INVALID_PAIR");
        TransferHelper.safeTransfer(_tokenIn, ISyncswapPool(pair).vault(), amountIn);

        uint256 initialBalance = IERC20(_tokenOut).balanceOf(_to);
        bytes memory data = abi.encode(_tokenIn, _to, 2);
        ISyncswapPool(pair).swap(data, msg.sender, address(0), "");

        uint256 balance = IERC20(_tokenOut).balanceOf(_to);
        amountOut = balance - initialBalance;
    }
}

contracts/integrations/SyncswapClassicPr.content:
// SPDX-License-Identifier: GPL-2.0-or-later
pragma solidity >=0.8.4;

import "../interfaces/IPriceFeedIntegration.sol";
import "../interfaces/IERC20.sol";
import "../interfaces/external/ISyncswapFactory.sol";
import "../interfaces/external/ISyncswapPool.sol";

contract SyncswapClassicPriceFeedIntegration is IPriceFeedIntegration {
    uint256 public constant override PRECISION = 1e30;
    address public immutable factory;

    constructor(address _factory) {
        factory = _factory;
    }

    function getPrice(
        address _baseToken,
        address _quoteToken
    ) external view override returns (uint256 price) {
        if (_baseToken == _quoteToken) {
            return PRECISION;
        }

        address pool = ISyncswapFactory(factory).getPool(
            _baseToken,
            _quoteToken
        );
        if (pool != address(0)) {
            address token0 = ISyncswapPool(pool).token0();
            (uint256 reserve0, uint256 reserve1) = ISyncswapPool(pool)
                .getReserves();
            (uint256 baseReserve, uint256 quoteReserve) = _baseToken == token0
                ? (reserve0, reserve1)
                : (reserve1, reserve0);
            if (baseReserve > 0) price = (quoteReserve * PRECISION) / baseReserve;
        }

        uint256 baseDecimals = IERC20(_baseToken).decimals();
        uint256 quoteDecimals = IERC20(_quoteToken).decimals();
        uint256 basePrec = 10 ** baseDecimals;
        uint256 quotePrec = 10 ** quoteDecimals;
        price = (price * basePrec) / quotePrec;
    }
}

